const Foodlist = ({ items, title }) => {
    return (
        <div>
            <h1> {title} </h1>
            {
                items.map((food) => {
                    return (
                        <div className="food">
                            <div className="food-img">
                                <img src={food.pic} alt="" />
                            </div>
                            <div>
                                <h2>{food.foodName} </h2>
                                <h6>{food.Price}</h6>
                            </div>
                        </div>
                    )

                })
            }
        </div>
    );
}

export default Foodlist;
